def semi_angle_limit(Lambda, C_3=1):

    C_3 *= 1.e7
    return 1.51 * C_3 ** (-1. / 4) * Lambda ** (1. / 4) * 1e3

def _ecdf_y(data, complementary=False):

    if complementary:
