    return result

def getTime(datetime):


    # Determine hour and suffix for 12-hour clock format based upon the value
    # of datetime.hour
    if datetime.hour == 0:
        hour = 12
        suffix = 'am'
    elif datetime.hour < 12:
        hour = datetime.hour
        suffix = 'am'
    elif datetime.hour == 12:
        hour = datetime.hour
        suffix = 'pm'
    else:
        hour = datetime.hour % 12
        suffix = 'pm'

    return '{}:{:02}{}'.format(hour, datetime.minute, suffix)

