def float_from_str(string):

    import re
    pattern = re.compile(r"\b[0-9]{1,3}(\.[0-9]{3})*(,[0-9]+)?\b|,[0-9]+\b")
    res = pattern.search(string)

    if res is None:
        return 0.0

    res = res.group()
    res = res.replace(".", "")
    res = res.replace(",", ".")

