def enum2dict(obj, key_filter=None):

    D = dict(obj.__dict__)
    D = dict(filter(lambda elem: not elem[0].startswith('__'), D.items()))
    if (key_filter is not None):
        D = dict(filter(lambda elem: key_filter(elem[0]), D.items()))
    return D

