def get_sentiment(text, analyzer):


    compound_score = analyzer.polarity_scores(text)['compound']

    if compound_score  >= 0.05:
        return 'positive'

    if compound_score <= -0.05:
        return 'negative'

    return 'neutral'

def to_pandas_edgelist(G, source='src', destination='dst'):

    pdf = G.to_pandas_edgelist(source=source, destination=destination)
    return pdf

def split_heads(x, num_heads):

    assert x.shape[-1] % num_heads == 0, str(x.shape)
    return x.reshape(x.shape[:-1] + (num_heads, x.shape[-1] // num_heads)).permute(0, 2, 1, 3)

def compute_ndvi(dataset):

    b4 = dataset.band_data.sel(band="B4")
    b8 = dataset.band_data.sel(band="B8A")
    ndvi = (b8 - b4) / (b8 + b4)
    return dataset.assign({"ndvi": ndvi})

def get_pad_tuple(padding, kernel):

    # compute the padding size
    if isinstance(padding, (tuple, list)):
        if len(padding) == 2:
            pad_h = padding[0] * 2
            pad_w = padding[1] * 2
        elif len(padding) == 4:
            return padding[0], padding[1], padding[2], padding[3]
        else:
            raise ValueError("Size of padding can only be 2 or 4")
    elif isinstance(padding, int):
        pad_h = pad_w = padding * 2
    elif padding == "VALID":
        pad_h = 0
        pad_w = 0
    elif padding == "SAME":
        pad_h = kernel[0] - 1
        pad_w = kernel[1] - 1
    else:
        raise ValueError("Unknown padding option %s" % padding)
    pad_top = (pad_h + 1) // 2
    pad_left = (pad_w + 1) // 2
    return pad_top, pad_left, pad_h - pad_top, pad_w - pad_left

